import React from 'react'

function SummaryOwnContent(props){
    return(
        <div className="summary-own">
            <img src={props.url}/>
            <div>
                <p>{props.name}</p>
                <p>owes you {props.amount}</p>
            </div>
        </div>
    )
}


export default SummaryOwnContent
